import React from "react";
import Scoreboard from "../components/Scoreboard";

function NavBar() {
    return (
        <div className="navBar">
            <div className="navBarTitle">Clicky Game!</div>
            <div className="navBarSummary">Click a photo to begin! Do your best to click each picture in a row without clicking on one you've already pressed.</div>
            <Scoreboard />
        </div>
    );
};

export default NavBar;
